import React from "react"

export default function MainContent()
{
    return(
    <div>
    <ol>
        <h1>Why i am excited to learn react</h1>
        <li>I am excited to learn React bc i wanna get a job</li>
        <li>It is more interesting than learning html</li>
        <li>It provides different way of building website</li>
    </ol>
    </div>
    )
}
